import './App.css';
// import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import CompanySearchContainer from './containers/CompanySearchContainer';
// import CompanyContainer from "./containers/CompanyContainer";
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import Button from 'react-bootstrap/Button';

function App() {
  return (
      <div>
        <Navbar bg="dark" variant="dark">
          <Navbar.Brand href="#home">Portfolio Planner</Navbar.Brand>
          <Nav className="mr-auto">
            <Nav.Link variant="outline-info" href="#home">Home</Nav.Link>
          </Nav>
            <Button variant="outline-info">Search</Button>
        </Navbar>
        <br />
        <CompanySearchContainer />
      </div>
    // <Router>
    //   <Switch>
    //     <Route path="/" exact component={CompanySearchContainer} />
    //     <Route path="/companyOverview/:id" exact component={CompanyContainer} />
    //   </Switch>
    // </Router>
  );
}

export default App;

